import React from 'react';
import {Box, Button, Flex, Heading, HStack, Text} from "@chakra-ui/react";

const AssignedInfo = () => {
    return (
        <Flex>
            <Flex bg={'white'} p={'5'} direction={'column'} flex={7}>
                <Heading>TITLE</Heading>
                <HStack>
                    <Text>Nguyen Khanh Duy</Text>
                    <Text>10 -1 -2012</Text>
                </HStack>
                <Text>DESCIPFDFHD</Text>
            </Flex>
            <Box w={'20px'}></Box>
            <Flex bg={'white'} p={'5'} direction={'column'} flex={3}>
                <Box>
                    <Button>Start</Button>
                </Box>
            </Flex>
        </Flex>
    );
};

export default AssignedInfo;
